// Carousel JavaScript
document.addEventListener('DOMContentLoaded', () => {
    const slides = document.getElementsByClassName("carousel-item");
    if (slides.length === 0) return;

    const carouselInner = document.querySelector(".carousel-inner");
    const numSlides = slides.length;

    // Clone first and last slides
    const firstClone = slides[0].cloneNode(true);
    const lastClone = slides[numSlides - 1].cloneNode(true);
    carouselInner.appendChild(firstClone);
    carouselInner.insertBefore(lastClone, slides[0]);

    let slideIndex = 1; // Start at the first "real" slide

    const updateCarousel = () => {
        carouselInner.style.transform = `translateX(-${slideIndex * 100}%)`;
    };

    // Set initial position
    carouselInner.style.transition = 'none';
    updateCarousel();

    // Force a reflow before re-enabling transitions
    carouselInner.offsetHeight; 

    carouselInner.style.transition = 'transform 0.5s ease-in-out';

    window.plusSlides = function(n) {
        slideIndex += n;
        carouselInner.style.transition = 'transform 0.5s ease-in-out';
        updateCarousel();
    }

    carouselInner.addEventListener('transitionend', () => {
        if (slideIndex === 0) {
            carouselInner.style.transition = 'none';
            slideIndex = numSlides;
            updateCarousel();
            carouselInner.offsetHeight; // Reflow
            carouselInner.style.transition = 'transform 0.5s ease-in-out';
        }
        if (slideIndex === numSlides + 1) {
            carouselInner.style.transition = 'none';
            slideIndex = 1;
            updateCarousel();
            carouselInner.offsetHeight; // Reflow
            carouselInner.style.transition = 'transform 0.5s ease-in-out';
        }
    });
});

